import React from 'react'
import "./Home.scss"

const card = ({img})=>(
  <img className='card' src={img} alt="cover" />
)

const Row = ({title})=>(
  <div>
    <h2>{title}</h2>

    <card img={"https://c8.alamy.com/comp/T33DPT/avengers-endgame-2019-directed-by-anthony-and-joe-russo-starring-bradley-cooper-brie-larson-and-chris-hemsworth-epic-conclusion-and-22nd-film-in-the-marvel-cinematic-universe-T33DPT.jpg"}/>
  </div>
)


const Home = () => {
  return (
    <section className="home">
      <div className="banner"></div>
    </section>
  )
}

export default Home
